import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Playlist from'./Playlist';
import Nav from './Nav';
import Profile from './Profile';
import Stats from './Stats';
import './App.css';

function App(){
    return(
        <Router>
            <div className="App">
                <Nav/>
                <Profile/>
                <Playlist/>
                <Stats/>
            </div>
        </Router>
    );
}

export default App;
